import React from 'react';
import { Container, Row, Col} from 'react-bootstrap';
import NavbarButom from '../components/NavbarButom';

const HomePage = () => {
  return (
    <div style={{ backgroundColor: '#3500ff', color: 'white', height: '100vh', padding: '2rem 1rem' }}>
      <Container fluid >
        <Row>
          <Col xs={12} md={7} className="d-flex flex-column justify-content-between" style={{ height: '100%' }}>
           
          </Col>
          <Col xs={12} md={5} className="d-flex flex-column justify-content-between">
            <div>
              <h1 className="display-1 fw-bold" style={{ textTransform: 'uppercase', lineHeight: '1.1' }}>
                Studio<br />Mega<br />The<br />Brigade<br />Push<br />Onx
              </h1>
            </div>
          </Col>
        </Row>
        <NavbarButom />
      </Container>
    </div>
  );
};

export default HomePage;
